import random

# accepts string from ulysses concordance as arg, returns string without line numbers
def remove_line_numbers(chapter):
    chapter_edit = ''
    for i in range (len(chapter)):
        if chapter[i] == "[" and chapter[i+1].isdigit():
            start_cut = i+11
            end_cut = chapter.find('[', i+1)
            chapter_edit+=chapter[start_cut:end_cut]
    return chapter_edit

# accepts string of chapter as arg and returns list of chapter without "--"'s and periods. 
def remove_dashes(chapter):
    chapter_edit = []
    chapter_split = chapter.split()
    for i in chapter_split:
        if i != '--':
            i=i.strip('.')
            chapter_edit.append(i.lower())
    return chapter_edit


